import React from 'react';
import PropTypes from 'prop-types';
import s from '../../styles.module.css'


const TransactionHistory = ({addNumber}) => (
  <table className={s.history}>
    <thead className={s.top}>
      <tr>
        <th>Transaction</th>
        <th>Amount</th>
        <th>Date</th>
      </tr>
    </thead>
    <tbody>
      {addNumber.map(el=> {
            <tr key={el.id}>
            <td>{el.type}</td>
            <td>{el.amount}$</td>
            <td>4/17/2019, 12:45:17</td>
          </tr>
      })}


    </tbody>
  </table>
)

export default TransactionHistory;
